import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

import Views from '../views';

const Home = Views.Home();

export default function RoutesPag(){
    return(
            <BrowserRouter>
                <HeaderPag/>
                <main>
                    <Routes>
                        <Route path="/" element={Home}/>
                    </Routes>
                </main>
                <FooterPag/>
            </BrowserRouter>

    );
};
